import Cell from "./Cell";

export default function Net({ x, y }: any) {
  let styles = {
    border: "3px solid green",
    padding: "5px",
    width: "auto",
    display: "grid",
    "grid-template-columns": `repeat(${x},20px)`,
    "grid-template-rows": `repeat(${y},20px)`,
  };

  let cells = [];
  for (let i = 0; i < x; i++) {
    for (let j = 0; j < y; j++) {
      cells.push(<Cell />);
    }
  }

  return (
    <div className="net" style={styles}>
      {cells}
    </div>
  );
}
